import { useParams } from "react-router-dom"
import { select_emp_name_id } from "../api"

export function Employee(){

    const {article_page}=useParams()



    return(
        <>
        {
            select_emp_name_id().map((item,index)=>{
                return
                <Id_name item={item} />
            })
        }
        </>   
    )
}

export function Id_name({item}){
    return(
        <input placeholder={item}  type='text'/>
    )
}
